import { Container, Row, Col, Button, Card } from "react-bootstrap";
function BestSellers() {
  return (
    <div /* className="About" */ /* style={sty2} */>
      <br />

      <Container>
        <br />
        <br />
        {/* Stack the columns on mobile by making one full-width and the other half-width */}
        <center>
          <font style={{ fontSize: "22px" }}>Best Sellers</font>
        </center>
        <br />
        <br />
        <center>
          <Row style={{ justify: "center", width: "70%" }}>
            <Col
              xs={12}
              md={6}
              style={{
                height: "40vh",
              }}
            >
              <Card style={{ width: "18rem" }}>
                <Card.Img variant="top" src="./assets/img/1.png" />
                <Card.Body>
                  <Card.Text>
                    Some quick example text to build on the card title and make
                    up the bulk of the card's content.
                  </Card.Text>
                </Card.Body>
              </Card>
            </Col>
            <Col
              xs={12}
              md={6}
              style={{
                backgroundImage: 'url("./img/1.jpeg")',
                height: "50vh",
                display: "flex",
                justifyContent: "center",
                alignItems: "end",
              }}
            >
              <Button
                btn="light"
                bg="light"
                variant="light"
                style={{
                  borderRadius: "0px",
                  marginBottom: "50px",
                  width: "200px",
                }}
              >
                Shop Bath Towels
              </Button>
            </Col>
            <Col
              xs={12}
              md={6}
              style={{
                backgroundImage: 'url("./img/2.jpg")',
                height: "50vh",
                display: "flex",
                justifyContent: "center",
                alignItems: "end",
              }}
            >
              <Button
                btn="light"
                bg="light"
                variant="light"
                style={{
                  borderRadius: "0px",
                  marginBottom: "50px",
                  width: "200px",
                }}
              >
                Shop Bath Robes
              </Button>
            </Col>
            <Col
              xs={12}
              md={6}
              style={{
                backgroundImage: 'url("./img/3.jpg")',
                height: "50vh",
                display: "flex",
                justifyContent: "center",
                alignItems: "end",
              }}
            >
              <Button
                btn="light"
                bg="light"
                variant="light"
                style={{
                  borderRadius: "0px",
                  marginBottom: "50px",
                  width: "200px",
                }}
              >
                Shop Home Fragrances
              </Button>
            </Col>
          </Row>
        </center>
      </Container>
    </div>
  );
}
export default BestSellers;
